import React from "react";

export default class HomePage extends React.Component {
  render() {
    return (
      <div className="jumbotron ">
        <h1>Welcome To ABC Mart</h1>
        <a href="/about">
          <button className="btn btn-danger mt-3">About</button>
        </a>
      </div>
    );
  }
}
